import React from 'react';
import styles from './footer.module.css'

const Footer = (props) =>{
    return <div className={styles.footer}>
        props.isAuth 
        ? <div>{props.login} </div>
        <button>logOut</button>
        : <div>you are not authorized</div> 
    </div>
}

export default Footer;
